    # create adjacency list
    graph = [[] for _ in range(n + 1)]
    for u, v, w in edges:
        graph[u].append((v, w))
        graph[v].append((u, w))

    # Kruskal's algorithm
    edges.sort(key=lambda x: x[2])
    mst = []
    min_cost = float('inf')
    for u, v, w in edges:
        if not mst or w < mst[-1][1]:
            mst.append((u, v, w))
            min_cost = min(min_cost, w)
        else:
            break

    # check if there is only one edge in the MST
    if len(mst) == m - 1:
        return '0'

    # increase weights of edges
    result = 0
    for i in range(len(mst) - 1):
        u, v, w = mst[i]
        if u == v:
            continue
        for _ in range(w // mst[i + 1][2]):
            result += 1
            u, v, w = mst[i][0], mst[i][1], mst[i][2]
            graph[u].remove((v, w))
            graph[v].remove((u, w))
            graph[u].append((v, w + 1))
            graph[v].append((u, w + 1))

    # check if there is only one edge in the MST
    if len(mst) == m - 1:
