        a -= 1
        b -= 1
        roads.append((a, b))

    def bfs(start):
        queue = [(start, [start])]
        visited = set()
        while queue:
            curr, path = queue.pop(0)
            if curr not in visited:
                visited.add(curr)
                if elevations[curr] > max(e for a, e in path):
                    return True
                for road in roads:
                    if road[1] in path:
                        continue
                    new_path = path + [road[1]]
                    if road[0] in visited:
                        if bfs(road[0]):
                            return True
                    else:
                        queue.append((road[0], new_path))
        return False

    return str(sum(1 for i in range(n) if elevations[i] > max(elevations[road[0]] for road in roads if road[1] == i) and bfs(i)))

