    def is_valid(grid: List[List[int]], row: int, col: int) -> bool:
        return 0 <= row < len(grid) and 0 <= col < len(grid[row]) and grid[row][col]!= 0

    def merge(grid: List[List[int]], row: int, col: int) -> None:
        if row > 0 and grid[row - 1][col] == grid[row][col]:
            grid[row - 1][col] *= 2
        if col > 0 and grid[row][col - 1] == grid[row][col]:
            grid[row][col - 1] *= 2
        if row < len(grid) - 1 and grid[row + 1][col] == grid[row][col]:
            grid[row + 1][col] *= 2
        if col < len(grid[row]) - 1 and grid[row][col + 1] == grid[row][col]:
            grid[row][col + 1] *= 2

    def move(grid: List[List[int]], row: int, col: int, direction: int) -> None:
        if direction == 0:
            # down
            while is_valid(grid, row + 1, col) and grid[row + 1][col] == 0:
                row += 1
        elif direction == 1:
            # left
            while is_valid(grid, row, col - 1) and grid[row][col - 1] == 0:
                col -= 1
        elif direction == 2:
            # right
            while is_valid(grid, row, col + 1) and grid[row][col + 1] == 0:
                col += 1
        elif direction == 3:
            # up
            while is_valid(grid, row - 1, col) and grid[row - 1][col] == 0:
                row -= 1
        grid[row][col] *= 2
        merge(grid, row, col)

    row, col, direction = [int(x) for x in stdin.split('\n')[4].split()]
