    sudoku_grid = [[0] * N for _ in range(N)]

    def find_neighbors(x, y):
        neighbors = []
        if y > 0:
            neighbors.append((x, y - 1))
        if y < N - 1:
            neighbors.append((x, y + 1))
        if x > 0:
            neighbors.append((x - 1, y))
        if x < N - 1:
            neighbors.append((x + 1, y))
        if x > 0 and y > 0:
            neighbors.append((x - 1, y - 1))
        if x < N - 1 and y > 0:
            neighbors.append((x + 1, y - 1))
        if x > 0 and y < N - 1:
            neighbors.append((x - 1, y + 1))
        if x < N - 1 and y < N - 1:
            neighbors.append((x + 1, y + 1))
        return neighbors

    def mark_cells(x, y, value):
        sudoku_grid[x][y] = value
        for neighbor in find_neighbors(x, y):
            if sudoku_grid[neighbor[0]][neighbor[1]] == 0:
                mark_cells(neighbor[0], neighbor[1], value)

    def backtrack(x, y, value):
        if x == N:
            return value
        for i in range(1, 10):
            if sudoku_grid[x][y] == 0:
                mark_cells(x, y, i)
                if backtrack(x + 1, y, value):
                    return True
                else:
                    sudoku_grid[x][y] = 0
        return False

    result = []
    for i in range(N):
        for j in range(N):
            value = matrix[i][j]
            if sudoku_grid[i][j] == 0:
                mark_cells(i, j, value)
                if backtrack(0, 0, value):
                    result = [0] * N
                    mark_cells(i, j, result)
                    break
                else:
                    sudoku_grid[i][j] = 0
    return''.join(str(x) for row in sudoku_grid for x in row)

