    rows, cols = map(int, stdin.split()[0:2])
    grid = [list(row) for row in stdin.split()[2:2+rows]]
    islands = 0
    stack = []

    def dfs(row, col, visited):
        nonlocal islands
        if grid[row][col] == 'L':
            visited[row][col] = True
            stack.append((row, col))

            up, down, left, right = (row-1, row+1, col-1, col+1)
            while 0 <= up < rows and 0 <= down < rows and 0 <= left < cols and 0 <= right < cols:
                if not visited[up][left] and grid[up][left] == 'L':
                    dfs(up, left, visited)
                if not visited[down][left] and grid[down][left] == 'L':
                    dfs(down, left, visited)
                if not visited[up][right] and grid[up][right] == 'L':
                    dfs(up, right, visited)
                if not visited[down][right] and grid[down][right] == 'L':
                    dfs(down, right, visited)
                up, down, left, right = (up-1, down+1, left-1, right+1)

            stack.pop()
            islands += 1

    for i in range(rows):
        for j in range(cols):
            if grid[i][j] == 'L' and not any(visited[i][k] for k in range(cols)):
                visited = [[False]*cols for _ in range(rows)]
                dfs(i, j, visited)

    return str(islands)

